// SPDX-License-Identifier: MIT

pragma solidity >=0.6.12 < 0.7.5;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

contract Claim is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IERC20 private _token;

    struct ClaimInfo {
        address claimToken;
        uint claimAmount;
    }

    uint256 public claimAmount;

    mapping(address => ClaimInfo) public claimInfoByToken;

    constructor(IERC20 token, uint256 amount) Ownable() public {
        require(address(token) != address(0), "token is the zero address");
        _token = token;
        claimAmount = amount * (10**uint256(18));
    }

    function token() public view returns (IERC20) {
        return _token;
    }

    /**
     * @dev update claim amount
     * @param amount the amount of claim
     */
    function updateClaimAmount(uint256 amount) public onlyOwner {
        claimAmount = amount * (10**uint256(18));
    }

    /**
     * @dev admin claim
     * @param claimToken the token of claim
     */
    function claimByAdmin(address claimToken) public onlyOwner {
        _claim(claimToken);
    }

    /**
     * @dev self claim
     */
    function claim() public {
        _claim(msg.sender);
    }

    /**
     * @dev claim function
     * @param claimToken the token of claim
     */
    function _claim(address claimToken) private {
        require(claimToken != address(0), 'claim from the zero address');
        ClaimInfo storage info = claimInfoByToken[claimToken];
        require(!(info.claimToken != address(0)) && info.claimAmount <= 0, 'Already Claim');

        _token.safeTransfer(claimToken, claimAmount);
        info.claimAmount = info.claimAmount.add(claimAmount);
    }

    /**
     * @dev killSelf function
     * @param recipientToken Receiving token address
     */
    function killSelf(address payable recipientToken) public onlyOwner {
        uint256 contractBalance = _token.balanceOf(address(this));
        _token.safeTransfer(recipientToken, contractBalance);

        selfdestruct(recipientToken);
    }
}
